import { IonButton, IonCol, IonGrid, IonInput, IonItem, IonLabel, IonRow } from "@ionic/react";
import React from "react";
import AgentForm from "../Forms/AgentForm";

const MultiForm: React.FC<{ buttonName: string, type: "agent" | "complex" | "package" | "promotion" }> = (props) => {
  let form;

  if(props.type === "agent"){
    form = (
      <AgentForm name={props.buttonName}/>
    );
  }else if (props.type === "complex"){
    form = (
    <h2>complex form</h2>)
    ;
  }else if (props.type === "package"){
    form = (
      <h2>package form</h2>
    );
  }else{
    form = (
      <h2>promotion form</h2>
    );
  }

  return (
    <>
    {form}
    </>
  );
};

export default MultiForm;
